import React  from 'react'
import { Link } from 'react-router-dom'
import { Container, Nav, Navbar, NavbarBrand } from 'reactstrap'


export interface  INavigationProps{}


const Naviagtion:React.FunctionComponent<INavigationProps>=props=>{
    return (
        <Navbar color="light;" sticky="top" expand="md">
            <Container>
                <NavbarBrand tag={Link} to ="/">QUIZRUN</NavbarBrand>
                <Nav className="mr-auto" navbar/>
            </Container>

        </Navbar>
    )
}


export default Naviagtion;
